.
üèÑ‚Äç‚ôÄÔ∏è WINDSWEPT: Many Richmonders know Craig Dodson, the former executive director of Richmond Cycling Corps, for operating the nation‚Äôs only competitive cycling program for youth living in public housing. Today, Craig can be found in #Irvington where he has channeled his love for bikes, adventure, and community into Windswept Experience & Supply Co. He recently revamped an old garage into a one-of-kind space for curated apparel, bicycle sales and rentals, bike service, paddle-board sales and rentals, and more @windswept_experience_supply_co. 
.
üè® QUIRK: In 2015, Richmonders Ted and Katie Ukrop opened @quirkhotelrva, a 74-room boutique hotel in downtown #Richmond in an Italian Renaissance building that once was a department store. Today, they‚Äôve expanded their concept to #Charlottesville, where Quirk occupies a space built around two historic homes on West Main St in the downtown area. Just like the Richmond flagship, @quirkhotelcva is styled in minimalist contemporary design and art from local artists. And like its sister property, the #Cville version boast an impressive rooftop bar and lounge. Not to mention an expansive barrel aged spirits bar, Bobboo. 
.
üèñ HOTEL CAPE CHARLES: Skip the crowded beaches and head straight to charming #CapeCharles on the Eastern Shore where Richmond‚Äôs very own David Gammino, a local entrepreneur, has lovingly renovated a historic building within walking distance of Cape Charles Beach into what is today known as @hotelcapecharles. We suggest booking a room facing the courtyard at Gammino‚Äôs boutique hotel and renting an electric golf cart form the front desk to check out @capecharlesbrewing or consider¬†an eco-tour to the wildlife refuge!";}i:251;a:1:{s:14:"comments_count";i:0;}i:252;a:1:{s:11:"likes_count";i:5;}i:253;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEvDKPJn2I6";}i:254;a:1:{s:5:"image";s:238:"https://scontent-sin6-1.cdninstagram.com/v/t51.2885-15/e35/118765881_955218968236591_8824761242114467169_n.jpg?_nc_ht=scontent-sin6-1.cdninstagram.com&_nc_cat=107&_nc_ohc=JehC8K2XrwIAX-V6-qi&oh=08da531aa05aacaf2f08dc4f33310d1c&oe=5F7D05C5";}i:255;a:1:{s:4:"type";s:7:"sidecar";}i:256;a:1:{s:8:"owner_id";i:4697497798;}i:257;a:1:{s:14:"owner_username";s:0:"";}i:258;a:1:{s:14:"owner_fullname";s:0:"";}i:259;a:1:{s:9:"owner_pic";s:0:"";}}